package TKDU::Certificate;
use Date::Format;
use Digest::SHA1 qw( sha1_hex );
use Imager::QRCode;
use MIME::Base64;


our $PATH = "/usr/local/tkdu/data/certificates";

# ============================================================
sub new {
# ============================================================
	my ($class) = map { ref || $_ } shift;
	my $self = bless {}, $class;
	$self->init( @_ );
	return $self;
}

# ============================================================
sub init {
# ============================================================
	my $self            = shift;
	$self->{ name }     = shift;
	$self->{ course }   = uc shift;
	$self->{ title }    = shift;
	$self->{ time }     = time;
	$self->{ date }     = time2str( "%o of %B, %Y", $self->{ time } );
	$self->{ logdate }  = time2str( "%Y-%m-%d %H:%M:%S", $self->{ time } );
	$self->{ sha1 }     = sha1_hex( join( "\t", @{$self}{ qw( name course title date ) }));
	$self->{ qrcode }   = $self->qr();
	$self->{ template } =<<EOF;
