# ============================================================
sub qr {
# ============================================================
	my $self   = shift;
	my $string = "http://pyongwon.sfsu.edu/tkduniversity/request/certificate/$self->{ sha1 }";
	my $qrcode = new Imager::QRCode();
	my $image  = $qrcode->plot( $string );
	my $bmp    = undef;

	$image->write( data => \$bmp, type => 'bmp' );
	my $data = encode_base64( $bmp );
	$data =~ s/\s//g;

	return $data;
}

# ============================================================
sub code {
# ============================================================
	my $self = shift;
	return $self->{ sha1 };
}

# ============================================================
sub date {
# ============================================================
	my $self = shift;
	return $self->{ logdate };
}

# ============================================================
sub svg {
# ============================================================
	my $self = shift;
	my $svg  = $self->{ template };

	$svg =~ s/\%name\%/$self->{ name }/;
	$svg =~ s/\%course\%/$self->{ course }/;
	$svg =~ s/\%course-title\%/$self->{ title }/;
	$svg =~ s/\%date\%/$self->{ date }/;
	$svg =~ s/\%qr\%/$self->{ qrcode }/;

	return $svg;
}

# ============================================================
sub write {
# ============================================================
	my $self = shift;
	my $svg  = $self->svg();
	my $file = "$PATH/$self->{ sha1 }.svg";
	open FILE, ">$file" or die "Can't write to '$file' $!";
	print FILE $svg;
	close FILE;
}

1;
